{"6": ["Хорошая комплектность, дополнил только маской (на всякий случай), к покупке ОЧЕНЬ РЕКОМЕНДУЮ!!!", "2021-03-26T19:43:05Z", "", "0", 2, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "7": ["Всё отлично. Но надо добовлять, йод, и перекись. Всё влезет, рекомендую", "2021-03-23T12:21:29Z", "", "0", 0, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "8": ["Набор понравился, пришёл целым, хорошо упакованным,  укомплектован согласно ГОСТу, только ножницы положила свои потому что не смогла разрезать ими ничего. Покупкой осталась очень довольна ", "2021-03-21T08:35:07Z", "", "0", 2, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "9": ["Очень маленькая, компактная. Жаль, что больше ничего не положить.", "2021-03-14T18:32:54Z", "", "0", 0, 1, 4, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "12": ["Состав аптечки соответствует заявленному, но ее явно необходимо дополнять другими медикаментами, как минимум перекисью. Пластыри не держатся, отвалились через несколько минут, а ножницы развалились при первом же использовании, не смогли разрезать тонюсенький бинт, непонятно вообще для чего предназначены.", "2021-02-28T21:50:53Z", "", "0", 2, 0, 4, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "14": ["Нормальная, но если хотите чем то дополнить то не стоит брать, всё в упор", "2021-02-23T19:24:27Z", "", "0", 1, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "16": ["Покупала в подарок, все понравилось!", "2021-02-09T21:18:39Z", "", "0", 0, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "18": ["Аптечка хорошо упакована. Компактная и убодная. Очень быстрая доставка", "2021-01-28T15:55:05Z", "", "0", 1, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "19": ["Долго выбирала аптечку, наконец остановила свой выбор на этой. Товар пришёл без внешних повреждений. Внутри на одном пакете обнаружилась дырочка, да ладно на неё. Ножницы-вообще атас, зачем их вообще класть было, отдайте сразу детям для игр, бутафория какая-то.. Заменила их на настоящие  маленькие детские, для трудов которые(режут отлично, и размер подходящий). Жгут не открывала, но подозреваю что-то похожее на эти ножницы будет, поэтому положила рядом широкую резинку.на всякий случай.. В общем- содержимое соответствует списку.качество хромает.", "2021-01-28T13:00:47Z", "", "0", 4, 0, 3, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "20": ["Аптечка неплохая, все устроило. Только не хватает масок, но это не проблема", "2021-01-27T14:39:49Z", "", "0", 2, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "25": ["Хорошая вещь", "2020-12-21T09:02:42Z", "", "0", 0, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "27": ["Хорошая аптечка, все необходимое для автомобильной аптечки есть (а она нужна, чтобы оказать первую помощь пока едет скорая). Если есть личные пожелания, то нужно докупить и положить.", "2020-11-13T12:24:32Z", "зеленый", "0", 3, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "28": ["Компактная  симпатичная аптечка , всё что необходимо есть , остальное можно добавить , по своему усмотрению , понравилась , спасибо !", "2020-10-11T07:36:23Z", "зеленый", "0", 1, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "29": ["За 1540 тенге полная аптечка, супер! Рекомендую.", "2019-12-13T11:10:20.253220906Z", "зеленый", "0", 3, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "30": ["Куча бинтов, лейкопластырь,ножницы, перчатки, жгут(резинка). Но все целое, сама дополню.  ", "2019-12-09T03:37:49.00267814Z", "зеленый", "0", 1, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "31": ["Аптечка под названием \"миллион и один маленький бинтик\", цена завышена . Купила 420 руб. Лучше собрать аптечку самостоятельно. ", "2019-11-05T18:24:43.085147591Z", "зеленый", "0", 3, 0, 2, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "33": ["Одни бинты на первый взгляд когда открываешь, а так по списку все.нужно докупить думаю йод, зеленку.", "2019-10-16T10:56:02.932543515Z", "зеленый", "0", 8, 0, 3, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "34": ["Набор хороший.  Советую", "2019-08-29T18:15:14.269776561Z", "зеленый", "0", 2, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "35": ["Аптечка и аптечка.Ценник конечно завышен.", "2019-08-17T18:56:48.363594749Z", "зеленый", "0", 0, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "36": ["Пришла с порезом на футляре, была в упаковке. Увидел уже дома. Состав как и у всех аптечек - для галочки. ", "2019-08-12T09:13:42.649328933Z", "зеленый", "0", 2, 0, 1, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "38": ["Самое главное - маленькая и мягкая. Не гремит и легко пристроить в багажнике или органайзере (например, рядом с запаской). Удалось впихнуть пару пластинок таблеток и йод на случай реальной необходимости в аптечке. Упакована была в целлофан, чистая.", "2019-06-25T19:42:15.147977613Z", "зеленый", "0", 3, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "39": ["Аккуратная, компактная. Но пришла без какой либо упаковки , пыльная и грязная. ", "2019-01-19T08:49:25.570217216Z", "зеленый", "0", 2, 0, 3, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "40": ["Маленькая и удобная, все что необходимо есть!", "2018-12-10T21:05:48.30392267Z", "зеленый", "0", 2, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "41": ["В аптечке все соответствует, и для формального прохождения тех осмотра она конечно подойдёт, но в реальности для оказания помощи нет, так как в аптечке все игрушечное:\r\nножницы, пластырь ощущение что для кукол, кровоостанавливающий жгут - резинка.\r\nВообщем остаются только бинты ( хотя я их не распаковывала, может и они только для вида).", "2018-12-06T12:30:28.125566693Z", "зеленый", "0", 2, 0, 3, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "42": ["Аптечка прошла техосмотр на ура, срок годности на техосмотре вообще не проверяют.", "2018-10-11T09:48:02.019787242Z", "зеленый", "0", 5, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "43": ["Все соответствует.", "2018-10-11T06:33:50.246090136Z", "зеленый", "0", 3, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "44": ["Отличная Аптечка на подарок", "2018-09-06T08:53:59.423821323Z", "зеленый", "0", 0, 2, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "45": ["Хорошая аптечка аккуратная , рекомендую.", "2018-08-23T16:52:31.40190552Z", "зеленый", "0", 12, 2, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "46": ["Отличная компактная аптечка!", "2018-03-05T19:33:50.124+03:00", "зеленый", "0", 1, 1, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"], "47": ["в целом понравилась. но оказалась сломанной молния на косметичке. отказ", "2018-02-27T14:43:06.578+03:00", "зеленый", "0", 2, 0, 5, "Аптечка автомобильная STVOL , текстильный футляр (соответствует требованиям ГИБДД)", "STVOL"]}
